var dms0_ventana = null;
var dms0_icono = null;

var dms1_ventana = null;
var dms1_icono = null;

var map = null;

function initialize() {
    google.maps.event.addDomListener(window, 'load', initialize);
    var latlng = new google.maps.LatLng(20.5870758, -103.8821886, 3.75);
    var myOptions = {
        zoom: 3,
        center: latlng,
        //mapTypeId: google.maps.MapTypeId.HYBRID
    };

    var map = new google.maps.Map(document.getElementById("map_canvas-01"), myOptions);
    var image = {
        url: 'images-solutec/iso-map-solutec.png',
        scaledSize: new google.maps.Size(50, 50),
    };

    // Contenido de la nube. Uno por cada dms

    var contentString0 = '<div id="content-marker-map">' +
        '<div id="siteNotice">' +
        '<h1 id="firstHeading" class="firstHeading"><b>Medell&iacute;n</b></h1>' +
        '<div id="bodyContent">' +
        '<p>Calle 9C. Sur N&deg;50FF - 116<br> <b>Centro Empresarial 9C sur <u>Oficina 401</u></b></p>' +
        '<p>Tel&eacutefono: +57 (4) 444 77 85</p>' +
        '</div>';

    var contentString = '<div id="content-marker-map">' +
        '<div id="siteNotice">' +
        '<h1 id="firstHeading" class="firstHeading"><b>Estados Unidos</b></h1>' +
        '<div id="bodyContent">' +
        '<p>1820N Corporate Lakes Blvd. Weston,<br> Suite 109 FL 33326.</p>' +
        '<p>Tel&eacutefono: +1 (305) 767 20 88</p>' +
        '</div>';

    // Ventana de la pmm, una por cada dms

    dms0_ventana = new google.maps.InfoWindow({
        content: contentString0
    });

    dms1_ventana = new google.maps.InfoWindow({
        content: contentString
    });


    // Icono de la pmm, uno por cada dms
    dms0_icono = new google.maps.Marker({
        position: new google.maps.LatLng(6.199941, -75.585864),
        icon: image,
        title: "Medell&iacute;n",
        optimized: false,
    });

    dms1_icono = new google.maps.Marker({
        position: new google.maps.LatLng(26.0947663, -80.3666044),
        icon: image,
        title: "Estados Unidos",
        optimized: false,
    });


    // Evento click del icno, uno por cada dms
    google.maps.event.addListener(dms0_icono, 'click', function() {
        dms0_ventana.close();
        dms1_ventana.close();
        dms0_ventana.open(map, dms0_icono);
        $("#check-m-01").prop('checked', true);
        $("#check-m-02").prop('checked', false);
        $("#check-m-03").prop('checked', false);
    });

    google.maps.event.addListener(dms1_icono, 'click', function() {
        dms0_ventana.close();
        dms1_ventana.close();
        dms1_ventana.open(map, dms1_icono);
        $("#check-m-02").prop('checked', true);
        $("#check-m-01").prop('checked', false);
        $("#check-m-03").prop('checked', false);
    });


    // agrego la dms al mapa, uno por cada dms;
    dms0_icono.setMap(map);
    dms1_icono.setMap(map);
}

function abrir_dms(dms) {

    switch (dms) {
        // Un case por cada dms
        case 'dms0':
            google.maps.event.trigger(dms0_icono, 'click');
            break;

        case 'dms1':
            google.maps.event.trigger(dms1_icono, 'click');
            break;
    }
}



